DROP TABLE IF EXISTS `achievement`;
CREATE TABLE `achievement` (
  `ID` int(4) NOT NULL,
  `points` int(2) NOT NULL DEFAULT '0',
  `name` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS `chartitles`;
CREATE TABLE `chartitles` (
  `titleId` int(3) NOT NULL,
  `wowheadId` int(3) NOT NULL DEFAULT '0',
  `nameString` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`titleId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS `savedimages`;
CREATE TABLE `savedimages` (
  `pgGUID` int(10) NOT NULL,
  `server` varchar(10) COLLATE utf8_bin NOT NULL,
  `queryString` text COLLATE utf8_bin NOT NULL,
  `imageName` varchar(255) COLLATE utf8_bin NOT NULL,
  `creation` int(12) NOT NULL,
  `lastEdit` int(12) NOT NULL,
  PRIMARY KEY (`pgGUID`,`server`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;



DROP TABLE IF EXISTS `talent`;
CREATE TABLE `talent` (
  `spellTalent` int(5) NOT NULL,
  `rankId` int(1) NOT NULL DEFAULT '0',
  `tabPage` int(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`spellTalent`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS `itemtemplate`;
CREATE TABLE `itemtemplate` (
  `entry` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `StatsCount` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `stat_type1` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `stat_value1` smallint(6) NOT NULL DEFAULT '0',
  `stat_type2` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `stat_value2` smallint(6) NOT NULL DEFAULT '0',
  `stat_type3` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `stat_value3` smallint(6) NOT NULL DEFAULT '0',
  `stat_type4` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `stat_value4` smallint(6) NOT NULL DEFAULT '0',
  `stat_type5` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `stat_value5` smallint(6) NOT NULL DEFAULT '0',
  `stat_type6` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `stat_value6` smallint(6) NOT NULL DEFAULT '0',
  `stat_type7` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `stat_value7` smallint(6) NOT NULL DEFAULT '0',
  `stat_type8` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `stat_value8` smallint(6) NOT NULL DEFAULT '0',
  `stat_type9` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `stat_value9` smallint(6) NOT NULL DEFAULT '0',
  `stat_type10` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `stat_value10` smallint(6) NOT NULL DEFAULT '0',
  PRIMARY KEY (`entry`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS `rating`;
CREATE TABLE `rating` (
  `level` int(11) NOT NULL DEFAULT '0',
  `CR_HIT_MELEE` float NOT NULL DEFAULT '0',
  `CR_HIT_RANGED` float NOT NULL DEFAULT '0',
  `CR_HIT_SPELL` float NOT NULL DEFAULT '0',
  `CR_HASTE_MELEE` float NOT NULL DEFAULT '0',
  `CR_HASTE_RANGED` float NOT NULL DEFAULT '0',
  `CR_HASTE_SPELL` float NOT NULL DEFAULT '0',
  PRIMARY KEY (`level`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;




CREATE TABLE IF NOT EXISTS `itemenchantment` (
  `ID` int(4) NOT NULL DEFAULT '0',
  `type0` int(1) NOT NULL DEFAULT '0',
  `type1` int(1) NOT NULL DEFAULT '0',
  `type2` int(1) NOT NULL DEFAULT '0',
  `amount0` int(3) NOT NULL DEFAULT '0',
  `amount1` int(3) NOT NULL DEFAULT '0',
  `amount2` int(2) NOT NULL DEFAULT '0',
  `spellid0` int(5) NOT NULL DEFAULT '0',
  `spellid1` int(5) NOT NULL DEFAULT '0',
  `spellid2` int(5) NOT NULL DEFAULT '0',
  `description` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

